import Menu from './Menu.js';
import React, {lazy} from 'react';
import { Link } from 'react-router-dom';

const HomePage = lazy(() => import('./HomePage.js'));

const Header = () => {
    return(
        <div id='header'>
            <img style={{height: '100em', width: '100em'}}src="https://greenviewsolutionsimages.s3.us-west-1.amazonaws.com/op/pencilsketchadjusted-9318928.png" />
            <Menu />
        </div>
    )
}

export default Header;
